import React from 'react';
import { FiSearch, FiBell, FiGrid, FiLogOut } from 'react-icons/fi';
import './GlobalHeader.css';

const GlobalHeader = ({ onLogout }) => {
  return (
    <header className="global-header">
      <div className="logo-header">
        <img src="/cropflow.png" alt="Cropflow Logo" className="auth-logo" />
        <span>Cropflow</span>
      </div>
      <div className="search-bar">
        <FiSearch />
        <input type="text" placeholder="Search" />
      </div>
      <div className="header-icons">
        <FiBell />
        <FiGrid />
        <div className="profile-badge">
          <span>RP Greenhouse</span>
          <img src="/rp-logo.png" alt="RP Logo" className="profile-logo-img" />
        </div>
        
        <button onClick={onLogout} className="logout-button">
          <FiLogOut />
        </button>

      </div>
    </header>
  );
};

export default GlobalHeader;
